import React from "react";
import "./styles.scss";

const FormLogin = () => {
  return (
    <div className="form">
      <section className="form__container">
        <h2>Incio de Sesión</h2>
        <div className="container--input-container">
          <input
            className="form__container--input-container--input"
            type="text"
            placeholder="Usuario"
          ></input>
          <input
            className="form__container--input-container--input"
            type="password"
            placeholder="Contraseña"
          ></input>
        </div>
        <button className="btn form__container--button">Iniciar sesión</button>
      </section>
    </div>
  );
};

export default FormLogin;
